package com.hlw.entries;

public class findMessage {
	private String memberphone;
	private String password;
	private String memberid;
	private String deptno;
	private String anwser;
	private String ques;
	public findMessage() {
		super();
		// TODO Auto-generated constructor stub
	}
	public findMessage(String memberphone, String password, String memberid, String deptno, String anwser,
			String ques) {
		super();
		this.memberphone = memberphone;
		this.password = password;
		this.memberid = memberid;
		this.deptno = deptno;
		this.anwser = anwser;
		this.ques = ques;
	}
	public String getMemberphone() {
		return memberphone;
	}
	public void setMemberphone(String memberphone) {
		this.memberphone = memberphone;
	}
	public String getPassword() {
		return password;
	}
	public void setPassword(String password) {
		this.password = password;
	}
	public String getMemberid() {
		return memberid;
	}
	public void setMemberid(String memberid) {
		this.memberid = memberid;
	}
	public String getDeptno() {
		return deptno;
	}
	public void setDeptno(String deptno) {
		this.deptno = deptno;
	}
	public String getAnwser() {
		return anwser;
	}
	public void setAnwser(String anwser) {
		this.anwser = anwser;
	}
	public String getQues() {
		return ques;
	}
	public void setQues(String ques) {
		this.ques = ques;
	}
	@Override
	public String toString() {
		return "findMessage [memberphone=" + memberphone + ", password=" + password + ", memberid=" + memberid
				+ ", deptno=" + deptno + ", anwser=" + anwser + ", ques=" + ques + "]";
	}
	
	
}
